defmodule ExAws.ComprehendTest do
  use ExUnit.Case

  test "detect labels" do
    {:ok, response} = 
      image_b64()
      |> ExAws.Rekognition.detect_labels()
      |> ExAws.request

    expected = 
      %{
        "LabelModelVersion" => "2.0",
        "Labels" => 
          [
            %{
              "Confidence" => 99.92823028564453,
              "Instances" => '',
              "Name" => "Vehicle",
              "Parents" => [%{"Name" => "Transportation"}]
            },
            %{
              "Confidence" => 99.92823028564453,
              "Instances" => '',
              "Name" => "Bike",
              "Parents" => [%{"Name" => "Vehicle"}, %{"Name" => "Transportation"}]
            },
            %{"Confidence" => 99.92823028564453, "Instances" => [], "Name" => "Transportation", "Parents" => []},
            %{
              "Confidence" => 99.92823028564453, 
              "Instances" => 
                [
                  %{
                    "BoundingBox" => 
                      %{
                        "Height" => 0.9145538210868835, 
                        "Left" => 0.014461605809628963, 
                        "Top" => 0.03162394091486931, 
                        "Width" => 0.9826823472976685}, 
                        "Confidence" => 99.92823028564453}
                ], 
              "Name" => "Bicycle", 
              "Parents" => [%{"Name" => "Vehicle"}, %{"Name" => "Transportation"}]
            },
            %{"Confidence" => 98.83491516113281, "Instances" => '', "Name" => "Machine", "Parents" => ''},
            %{
              "Confidence" => 98.83491516113281,
              "Instances" => 
                [
                  %{
                    "BoundingBox" => 
                      %{
                        "Height" => 0.6450497508049011, 
                        "Left" => 0.5007983446121216, 
                        "Top" => 0.34399232268333435, 
                        "Width" => 0.47830554842948914
                      }, 
                    "Confidence" => 98.83491516113281
                  },
                  %{
                    "BoundingBox" => 
                      %{
                        "Height" => 0.504228949546814, 
                        "Left" => 0.020825780928134918, 
                        "Top" => 0.2842612564563751, 
                        "Width" => 0.32769620418548584
                      }, 
                    "Confidence" => 96.69020080566406
                  }
                ],
              "Name" => "Wheel",
              "Parents" => [%{"Name" => "Machine"}]
            },
            %{
              "Confidence" => 96.54385375976563, 
              "Instances" => [], 
              "Name" => "Mountain Bike", 
              "Parents" => [%{"Name" => "Vehicle"}, %{"Name" => "Transportation"}, %{"Name" => "Bicycle"}]
            }
          ]
      }

    assert response == expected
  end

  defp image_b64() do
""
  end

end
